        {
            "Qux",
            null
        }
    };
    ValueTask Fetch(IReadOnlyList<string> keys, Memory<Result<string>> results, CancellationToken cancellationToken)
    {
        var span = results.Span;
        for (var i = 0; i < keys.Count; i++)
        {
            if (repository.TryGetValue(keys[i], out var result))
            {
                span[i] = result;
            }
        }

        return default;
    }

    var batchScheduler = new ManualBatchScheduler();
